contracts/MasterChef.sol.content:
// SPDX-License-Identifier: MIT
pragma experimental ABIEncoderV2;
pragma solidity >=0.6.12;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./interfaces/IRewarder.sol";
import "./Mora.sol";

contract MasterChef is Ownable, ReentrancyGuard {
    string public constant name = "MasterChef";
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    using SafeERC20 for Mora;

    struct UserInfo {
        uint256 amount;
        uint256 rewardDebt;
    }

    struct PoolInfo {
        IERC20 lpToken;
        uint256 allocPoint;
        uint256 lastRewardTime;
        uint256 accMoraPerShare;
        uint256 totalLp;
        address rewarder; // bonus other tokens
    }

    Mora public immutable mora;
    uint256 public immutable startTime;
    address public constant burnAddress = address(0x000000000000000000000000000000000000dEaD);
    uint256 public burnPercent;
    uint256 public moraPerSecond;

    PoolInfo[] public poolInfo;
    mapping (uint256 => mapping (address => UserInfo)) public userInfo;
    uint256 public totalAllocPoint;

    event SetEmissionRate(uint256 moraPerSecond);
    event SetBonusEmissionRate(uint256 indexed pid, uint256 rewardPerSecond);
    event SetPercent(uint256 burnPercent);
    event AddPool(uint256 allocPoint, address lpToken, address rewarder);
    event SetPool(uint256 indexed pid, uint256 allocPoint, address rewarder);
    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event EmergencyWithdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event FailedToNotifyRewarder(address indexed user, uint256 indexed pid);

    constructor(
        Mora _mora,
        uint256 _moraPerSecond,
        uint256 _burnPercent,
        uint256 _startTime
    ) public {
        mora = _mora;
        moraPerSecond = _moraPerSecond;
        burnPercent = _burnPercent;
        startTime = _startTime;
    }

    function setEmissionRate(uint256 _moraPerSecond) external onlyOwner {
        updateAllPools();
        moraPerSecond = _moraPerSecond;

        emit SetEmissionRate(_moraPerSecond);
    }

    function setBonusEmissionRate(uint _pid, uint _rewardPerSecond) external onlyOwner {
        require(_pid < poolInfo.length, "setBonusEmissionRate: The pool does not exist");
        PoolInfo storage pool = poolInfo[_pid];

        updatePool(_pid);

        address rewarder = pool.rewarder;
        if (rewarder != address(0)) {
            IRewarder(rewarder).setRewardPerSecond(_rewardPerSecond);
        }

        emit SetBonusEmissionRate(_pid, _rewardPerSecond);
    }

    function setPercent(
        uint256 _burnPercent) external onlyOwner {
        require(_burnPercent < 100e18, "setPercent: Percent cannot exceed 100");
        updateAllPools();
        burnPercent = _burnPercent;

        emit SetPercent(_burnPercent);
    }

    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }

    function addPool(uint256 _allocPoint, IERC20 _lpToken, address _rewarder) external onlyOwner {
        updateAllPools();

        uint256 lastRewardTime = block.timestamp > startTime ? block.timestamp : startTime;
        totalAllocPoint = totalAllocPoint.add(_allocPoint);
        poolInfo.push(PoolInfo({
            lpToken: _lpToken,
            allocPoint: _allocPoint,
            lastRewardTime: lastRewardTime,
            accMoraPerShare: 0,
            totalLp: 0,
            rewarder: _rewarder
        }));

        emit AddPool(_allocPoint, address(_lpToken), _rewarder);
    }

    function setPool(uint256 _pid, uint256 _allocPoint, address _rewarder) external onlyOwner {
        require(_pid < poolInfo.length, "setPool: The pool does not exist");
        updateAllPools();

        totalAllocPoint = totalAllocPoint.add(_allocPoint).sub(poolInfo[_pid].allocPoint);
        poolInfo[_pid].allocPoint = _allocPoint;
        poolInfo[_pid].rewarder = _rewarder;

        emit SetPool(_pid, _allocPoint, _rewarder);
    }

    function getMultiplier(uint256 _from, uint256 _to) private pure returns (uint256) {
        return _to.sub(_from);
    }

    function pendingReward(uint256 _pid, address _user) external view returns (uint256 pendingMora, uint256 pendingBonus) {
        require(_pid < poolInfo.length, "pendingReward: The pool does not exist");
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][_user];
        uint256 accMoraPerShare = pool.accMoraPerShare;
        uint256 lpSupply = pool.totalLp;
        uint256 lastRewardTime = pool.lastRewardTime;
        if (block.timestamp > lastRewardTime && lpSupply != 0) {
            uint256 multiplier = getMultiplier(lastRewardTime, block.timestamp);
            uint256 moraReward = multiplier.mul(moraPerSecond).mul(pool.allocPoint).div(totalAllocPoint);

            ( , uint256 farmMora) = calculate(moraReward);

            accMoraPerShare = accMoraPerShare.add(farmMora.mul(1e18).div(lpSupply));
        }
        pendingMora = user.amount.mul(accMoraPerShare).div(1e18).sub(user.rewardDebt);
        address rewarder = pool.rewarder;
        if (rewarder != address(0)) {
            pendingBonus = IRewarder(rewarder).pendingReward(_user, user.amount);
        }
    }

    function updateAllPools() public {
        uint256 length = poolInfo.length;
        for (uint256 pid = 0; pid < length; pid++) {
            updatePool(pid);
        }
    }

    function updateMultiplePools(uint256[] memory pids) external {
        for (uint256 i = 0; i < pids.length; i++) {
            updatePool(pids[i]);
        }
    }

    function calculate(uint256 _reward) private view returns (uint256 burnMora, uint256 farmMora) {
        uint256 totalSupply = mora.totalSupply();
        uint256 maxSupply = mora.maxSupply();
        if (maxSupply < totalSupply.add(_reward)) {
            _reward = maxSupply.sub(totalSupply);
        }
        
        burnMora = _reward.mul(burnPercent).div(100e18);
        farmMora = _reward.sub(burnMora);
    }

    function updatePool(uint256 _pid) public {
        require(_pid < poolInfo.length, "updatePool: The pool does not exist");
        PoolInfo storage pool = poolInfo[_pid];
        uint256 lastRewardTime = pool.lastRewardTime;
        if (block.timestamp <= lastRewardTime) {
            return;
        }
        uint256 lpSupply = pool.totalLp;
        if (lpSupply == 0 || pool.allocPoint == 0) {
            pool.lastRewardTime = block.timestamp;
            return;
        }

        uint256 multiplier = getMultiplier(lastRewardTime, block.timestamp);
        uint256 moraReward = multiplier.mul(moraPerSecond).mul(pool.allocPoint).div(totalAllocPoint);

        (uint256 burnMora, uint256 farmMora) = calculate(moraReward);

        mora.mint(address(this), burnMora.add(farmMora));
        if (burnMora > 0) {
            mora.transfer(burnAddress, burnMora);
        }

        pool.accMoraPerShare = pool.accMoraPerShare.add(farmMora.mul(1e18).div(lpSupply));
        pool.lastRewardTime = block.timestamp;
    }

    function deposit(uint256 _pid, uint256 _amount) external nonReentrant {
        require(_pid < poolInfo.length, "deposit: The pool does not exist");
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];

        updatePool(_pid);
        uint256 amount = user.amount;
        uint256 accMoraPerShare = pool.accMoraPerShare;
        uint lpSupply = pool.totalLp;
        if (amount > 0) {
            uint256 pending = amount.mul(accMoraPerShare).div(1e18).sub(user.rewardDebt);
            mora.safeTransfer(address(msg.sender), pending);
        }

        if(_amount > 0) {
            pool.lpToken.safeTransferFrom(address(msg.sender), address(this), _amount);
            user.amount = amount.add(_amount);
            pool.totalLp = lpSupply.add(_amount);
        }
        
        amount = user.amount;
        address rewarder = pool.rewarder;
        if (rewarder != address(0)) {
            IRewarder(rewarder).onReward(address(msg.sender), amount);
        }
        user.rewardDebt = amount.mul(accMoraPerShare).div(1e18);

        emit Deposit(msg.sender, _pid, _amount);
    }

    function withdraw(uint256 _pid, uint256 _amount) external nonReentrant {
        require(_pid < poolInfo.length, "withdraw: BAD POOL");
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        uint256 amount = user.amount;
        require(amount >= _amount, "withdraw: Exceeded user's amount");

        updatePool(_pid);
        uint256 accMoraPerShare = pool.accMoraPerShare;
        uint lpSupply = pool.totalLp;
        if (amount > 0) {
            uint256 pending = amount.mul(accMoraPerShare).div(1e18).sub(user.rewardDebt);
            mora.safeTransfer(address(msg.sender), pending);
        }

        if(_amount > 0) {
            user.amount = amount.sub(_amount);
            pool.totalLp = lpSupply.sub(_amount);
            pool.lpToken.safeTransfer(address(msg.sender), _amount);
        }
            
        amount = user.amount;
        address rewarder = pool.rewarder;
        if (rewarder != address(0)) {
            IRewarder(rewarder).onReward(address(msg.sender), amount);
        }
        user.rewardDebt = amount.mul(accMoraPerShare).div(1e18);

        emit Withdraw(msg.sender, _pid, _amount);
    }

    // only for emergency case and users do not care about reward
    function emergencyWithdraw(uint256 _pid) external nonReentrant {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        uint256 amount = user.amount;
        user.amount = 0;
        address rewarder = pool.rewarder;
        pool.totalLp = pool.totalLp.sub(amount);
        user.rewardDebt = 0;
        pool.lpToken.safeTransfer(address(msg.sender), amount);
        emit EmergencyWithdraw(msg.sender, _pid, amount);

        uint256 size;
        assembly {
            size := extcodesize(rewarder)
        }
        if (rewarder != address(0) && size > 0) {
            try IRewarder(rewarder).onReward(address(msg.sender), 0) {} catch {
                emit FailedToNotifyRewarder(msg.sender, _pid);
            }
        }
    }
}

contracts/Mora.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Mora is ERC20("Mora", "MORA"), Ownable {
    uint private _maxSupply = 1000000000e18;
    uint private _initialSupply = 500000000e18;

    /**
     * @dev Returns the max supply
     */
    function maxSupply() public view returns (uint) {
        return _maxSupply;
    }

    /**
     * @dev See {ERC20-_beforeTokenTransfer}.
     *
     * Requirements:
     *
     * - minted tokens must not cause the total supply to go over the max supply.
     */
    function _beforeTokenTransfer(address from, address to, uint amount) internal virtual override {
        super._beforeTokenTransfer(from, to, amount);

        if (from == address(0)) { // When minting tokens
            require(totalSupply().add(amount) <= _maxSupply, "ERC20Capped: Max supply exceeded");
        }
    }

    /**
     * @dev Moves tokens `amount` from `sender` to `recipient`.
     *
     * This is internal function is equivalent to {transfer}, and can be used to
     * e.g. implement automatic token fees, slashing mechanisms, etc.
     *
     * Emits a {Transfer} event.
     *
     * Requirements:
     *
     * - `sender` cannot be the zero address.
     * - `recipient` cannot be the zero address.
     * - `sender` must have a balance of at least `amount`.
     */
    function _transfer(address sender, address recipient, uint amount) internal virtual override {
        super._transfer(sender, recipient, amount);
        _moveDelegates(_delegates[sender], _delegates[recipient], amount);
    }

    /// @notice Creates `_amount` token to `_to`. Must only be called by the owner (MasterChef).
    function mint(address _to, uint _amount) public onlyOwner {
        _mint(_to, _amount);
        _moveDelegates(address(0), _delegates[_to], _amount);
    }

    function burn(uint _amount) public {
        super._burn(msg.sender, _amount);
    }

    // Copied and modified from YAM code:
    // https://github.com/yam-finance/yam-protocol/blob/master/contracts/token/YAMGovernanceStorage.sol
    // https://github.com/yam-finance/yam-protocol/blob/master/contracts/token/YAMGovernance.sol
    // Which is copied and modified from COMPOUND:
    // https://github.com/compound-finance/compound-protocol/blob/master/contracts/Governance/Comp.sol

    /// @dev A record of each accounts delegate
    mapping (address => address) internal _delegates;

    /// @notice A checkpoint for marking number of votes from a given block
    struct Checkpoint {
        uint32 fromBlock;
        uint votes;
    }

    /// @notice A record of votes checkpoints for each account, by index
    mapping (address => mapping (uint32 => Checkpoint)) public checkpoints;

    /// @notice The number of checkpoints for each account
    mapping (address => uint32) public numCheckpoints;

    /// @notice The EIP-712 typehash for the contract's domain
    bytes32 public constant DOMAIN_TYPEHASH = keccak256("EIP712Domain(string name,uint chainId,address verifyingContract)");

    /// @notice The EIP-712 typehash for the delegation struct used by the contract
    bytes32 public constant DELEGATION_TYPEHASH = keccak256("Delegation(address delegatee,uint nonce,uint expiry)");

    /// @notice A record of states for signing / validating signatures
    mapping (address => uint) public nonces;

      /// @notice An event thats emitted when an account changes its delegate
    event DelegateChanged(address indexed delegator, address indexed fromDelegate, address indexed toDelegate);

    /// @notice An event thats emitted when a delegate account's vote balance changes
    event DelegateVotesChanged(address indexed delegate, uint previousBalance, uint newBalance);

    /**
     * @notice Delegate votes from `msg.sender` to `delegatee`
     * @param delegator The address to get delegatee for
     */
    function delegates(address delegator)
        external
        view
        returns (address)
    {
        return _delegates[delegator];
    }

   /**
    * @notice Delegate votes from `msg.sender` to `delegatee`
    * @param delegatee The address to delegate votes to
    */
    function delegate(address delegatee) external {
        return _delegate(msg.sender, delegatee);
    }

    /**
     * @notice Delegates votes from signatory to `delegatee`
     * @param delegatee The address to delegate votes to
     * @param nonce The contract state required to match the signature
     * @param expiry The time at which to expire the signature
     * @param v The recovery byte of the signature
     * @param r Half of the ECDSA signature pair
     * @param s Half of the ECDSA signature pair
     */
    function delegateBySig(
        address delegatee,
        uint nonce,
        uint expiry,
        uint8 v,
        bytes32 r,
        bytes32 s
    )
        external
    {
        bytes32 domainSeparator = keccak256(
            abi.encode(
                DOMAIN_TYPEHASH,
                keccak256(bytes(name())),
                getChainId(),
                address(this)
            )
        );

        bytes32 structHash = keccak256(
            abi.encode(
                DELEGATION_TYPEHASH,
                delegatee,
                nonce,
                expiry
            )
        );

        bytes32 digest = keccak256(
            abi.encodePacked(
                "\x19\x01",
                domainSeparator,
                structHash
            )
        );

        address signatory = ecrecover(digest, v, r, s);
        require(signatory != address(0), "delegateBySig: invalid signature");
        require(nonce == nonces[signatory]++, "delegateBySig: invalid nonce");
        require(now <= expiry, "delegateBySig: signature expired");
        return _delegate(signatory, delegatee);
    }

    /**
     * @notice Gets the current votes balance for `account`
     * @param account The address to get votes balance
     * @return The number of current votes for `account`
     */
    function getCurrentVotes(address account)
        external
        view
        returns (uint)
    {
        uint32 nCheckpoints = numCheckpoints[account];
        return nCheckpoints > 0 ? checkpoints[account][nCheckpoints - 1].votes : 0;
    }

    /**
     * @notice Determine the prior number of votes for an account as of a block number
     * @dev Block number must be a finalized block or else this function will revert to prevent misinformation.
     * @param account The address of the account to check
     * @param blockNumber The block number to get the vote balance at
     * @return The number of votes the account had as of the given block
     */
    function getPriorVotes(address account, uint blockNumber)
        external
        view
        returns (uint)
    {
        require(blockNumber < block.number, "getPriorVotes: not yet determined");

        uint32 nCheckpoints = numCheckpoints[account];
        if (nCheckpoints == 0) {
            return 0;
        }

        // First check most recent balance
        if (checkpoints[account][nCheckpoints - 1].fromBlock <= blockNumber) {
            return checkpoints[account][nCheckpoints - 1].votes;
        }

        // Next check implicit zero balance
        if (checkpoints[account][0].fromBlock > blockNumber) {
            return 0;
        }

        uint32 lower = 0;
        uint32 upper = nCheckpoints - 1;
        while (upper > lower) {
            uint32 center = upper - (upper - lower) / 2; // ceil, avoiding overflow
            Checkpoint memory cp = checkpoints[account][center];
            if (cp.fromBlock == blockNumber) {
                return cp.votes;
            } else if (cp.fromBlock < blockNumber) {
                lower = center;
            } else {
                upper = center - 1;
            }
        }
        return checkpoints[account][lower].votes;
    }

    function _delegate(address delegator, address delegatee)
        internal
    {
        address currentDelegate = _delegates[delegator];
        uint delegatorBalance = balanceOf(delegator);
        _delegates[delegator] = delegatee;

        emit DelegateChanged(delegator, currentDelegate, delegatee);

        _moveDelegates(currentDelegate, delegatee, delegatorBalance);
    }

    function _moveDelegates(address srcRep, address dstRep, uint amount) internal {
        if (srcRep != dstRep && amount > 0) {
            if (srcRep != address(0)) {
                // decrease old representative
                uint32 srcRepNum = numCheckpoints[srcRep];
                uint srcRepOld = srcRepNum > 0 ? checkpoints[srcRep][srcRepNum - 1].votes : 0;
                uint srcRepNew = srcRepOld.sub(amount);
                _writeCheckpoint(srcRep, srcRepNum, srcRepOld, srcRepNew);
            }

            if (dstRep != address(0)) {
                // increase new representative
                uint32 dstRepNum = numCheckpoints[dstRep];
                uint dstRepOld = dstRepNum > 0 ? checkpoints[dstRep][dstRepNum - 1].votes : 0;
                uint dstRepNew = dstRepOld.add(amount);
                _writeCheckpoint(dstRep, dstRepNum, dstRepOld, dstRepNew);
            }
        }
    }

    function _writeCheckpoint(
        address delegatee,
        uint32 nCheckpoints,
        uint oldVotes,
        uint newVotes
    )
        internal
    {
        uint32 blockNumber = safe32(block.number, "_writeCheckpoint: block number exceeds 32 bits");

        if (nCheckpoints > 0 && checkpoints[delegatee][nCheckpoints - 1].fromBlock == blockNumber) {
            checkpoints[delegatee][nCheckpoints - 1].votes = newVotes;
        } else {
            checkpoints[delegatee][nCheckpoints] = Checkpoint(blockNumber, newVotes);
            numCheckpoints[delegatee] = nCheckpoints + 1;
        }

        emit DelegateVotesChanged(delegatee, oldVotes, newVotes);
    }

    function safe32(uint n, string memory errorMessage) internal pure returns (uint32) {
        require(n < 2**32, errorMessage);
        return uint32(n);
    }

    function getChainId() internal pure returns (uint) {
        uint chainId;
        assembly { chainId := chainid() }
        return chainId;
    }

    constructor() public {
        _mint(msg.sender, _initialSupply);
        _moveDelegates(address(0), msg.sender, _initialSupply);
    }
}

contracts/MoraMakerV2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@moraswap/v2-core/contracts/interfaces/IMoraswapV2ERC20.sol";
import "@moraswap/v2-core/contracts/interfaces/IMoraswapV2Pair.sol";
import "@moraswap/v2-core/contracts/interfaces/IMoraswapV2Factory.sol";

contract MoraMakerV2 is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IMoraswapV2Factory public immutable factory;
    address public immutable xmora;
    address private immutable mora;
    address private immutable usdc;
    address private immutable weth;
    uint256 public boughtUsdc;
    uint256 public boughtMora;

    address public treasury;
    uint256 public moraBuybackPercent; // 1000 <=> 100%

    mapping(address => address) internal _moraBridges;
    mapping(address => address) internal _usdcBridges;

    event LogMoraBridgeSet(address indexed token, address indexed bridge);
    event LogUsdcBridgeSet(address indexed token, address indexed bridge);
    event LogTreasurySet(address indexed treasury);
    event LogMoraBuybackPercentSet(uint256 percent);
    event LogConvertSingleToken(
        address indexed server,
        address indexed token,
        uint256 amount,
        uint256 amountMORA,
        uint256 amountUSDC
    );
    event LogConvertToMORA(
        address indexed server,
        address indexed token0,
        address indexed token1,
        uint256 amount0,
        uint256 amount1,
        uint256 amount
    );
    event LogConvertToUSDC(
        address indexed server,
        address indexed token0,
        address indexed token1,
        uint256 amount0,
        uint256 amount1,
        uint256 amount
    );

    constructor(
        address _factory,
        address _xmora,
        address _mora,
        address _usdc,
        address _weth,
        address _treasury
    ) public {
        factory = IMoraswapV2Factory(_factory);
        xmora = _xmora;
        mora = _mora;
        usdc = _usdc;
        weth = _weth;
        treasury = _treasury;
        moraBuybackPercent = 800; // default: 80%
    }

    receive() external payable {
        assert(msg.sender == weth); // only accept ETH via fallback from the WETH contract
    }

    function moraBridgeFor(address token) public view returns (address bridge) {
        bridge = _moraBridges[token];
        if (bridge == address(0)) {
            bridge = weth;
        }
    }

    function usdcBridgeFor(address token) public view returns (address bridge) {
        bridge = _usdcBridges[token];
        if (bridge == address(0)) {
            bridge = weth;
        }
    }

    function setMoraBridge(address token, address bridge) external onlyOwner {
        require(
            token != mora && token != weth && token != bridge,
            "MoraMaker: Invalid bridge"
        );

        _moraBridges[token] = bridge;
        emit LogMoraBridgeSet(token, bridge);
    }

    function setUsdcBridge(address token, address bridge) external onlyOwner {
        require(
            token != mora && token != weth && token != bridge,
            "MoraMaker: Invalid bridge"
        );

        _usdcBridges[token] = bridge;
        emit LogUsdcBridgeSet(token, bridge);
    }

    function setTreasury(address _treasury) external onlyOwner {
        treasury = _treasury;
        emit LogTreasurySet(_treasury);
    }

    function setMoraBuybackPercent(uint256 _moraBuybackPercent) external onlyOwner {
        require(
            _moraBuybackPercent <= 1000,
            "MoraMaker: Invalid percent"
        );

        moraBuybackPercent = _moraBuybackPercent;
        emit LogMoraBuybackPercentSet(_moraBuybackPercent);
    }

    function calculate(uint256 _amount) internal view returns (uint256 amountToMora, uint256 amountToUsdc) {
        amountToMora = _amount.mul(moraBuybackPercent).div(1000);
        amountToUsdc = _amount.sub(amountToMora);
    }

    function convertSingleToken(address token) external {
        uint256 amount = IERC20(token).balanceOf(address(this));
        (uint256 amountToMora, uint256 amountToUsdc) = calculate(amount);
        emit LogConvertSingleToken(
            msg.sender,
            token,
            amount,
            _toMORA(token, amountToMora),
            _toUSDC(token, amountToUsdc)
        );
    }

    function convertMultipleSingleToken(
        address[] calldata token
    ) external {
        uint256 len = token.length;
        for (uint256 i = 0; i < len; i++) {
            uint256 amount = IERC20(token[i]).balanceOf(address(this));
            (uint256 amountToMora, uint256 amountToUsdc) = calculate(amount);
            emit LogConvertSingleToken(
                msg.sender,
                token[i],
                amount,
                _toMORA(token[i], amountToMora),
                _toUSDC(token[i], amountToUsdc)
            );
        }
    }

    function convert(address token0, address token1) external {
        _convert(token0, token1);
    }

    function convertMultiple(
        address[] calldata token0,
        address[] calldata token1
    ) external {
        uint256 len = token0.length;
        for (uint256 i = 0; i < len; i++) {
            _convert(token0[i], token1[i]);
        }
    }

    function _convert(address token0, address token1) internal {
        IMoraswapV2Pair pair = IMoraswapV2Pair(factory.getPair(token0, token1));
        require(address(pair) != address(0), "MoraMaker: Invalid pair");
        IERC20(address(pair)).safeTransfer(
            address(pair),
            pair.balanceOf(address(this))
        );
        (uint256 amount0, uint256 amount1) = pair.burn(address(this));
        if (token0 != pair.token0()) {
            (amount0, amount1) = (amount1, amount0);
        }
        (uint256 amountToMora0, uint256 amountToUsdc0) = calculate(amount0);
        (uint256 amountToMora1, uint256 amountToUsdc1) = calculate(amount1);

        uint256 moraOut = _convertToMORAStep(token0, token1, amountToMora0, amountToMora1);
        boughtMora = boughtMora.add(moraOut);
        emit LogConvertToMORA(
            msg.sender,
            token0,
            token1,
            amountToMora0,
            amountToMora1,
            moraOut
        );

        uint256 usdcOut = _convertToUSDCStep(token0, token1, amountToUsdc0, amountToUsdc1);
        boughtUsdc = boughtUsdc.add(usdcOut);
        emit LogConvertToUSDC(
            msg.sender,
            token0,
            token1,
            amountToUsdc0,
            amountToUsdc1,
            usdcOut
        );
    }

    function _convertToMORAStep(address token0, address token1, uint256 amount0, uint256 amount1) internal returns(uint256 moraOut) {
        if (token0 == token1) {
            uint256 amount = amount0.add(amount1);
            if (token0 == mora) {
                IERC20(mora).safeTransfer(xmora, amount);
                moraOut = amount;
            } else if (token0 == weth) {
                moraOut = _toMORA(weth, amount);
            } else {
                address bridge = moraBridgeFor(token0);
                amount = _swap(token0, bridge, amount, address(this));
                moraOut = _convertToMORAStep(bridge, bridge, amount, 0);
            }
        } else if (token0 == mora) { // eg. MORA - NEON
            IERC20(mora).safeTransfer(xmora, amount0);
            moraOut = _toMORA(token1, amount1).add(amount0);
        } else if (token1 == mora) { // eg. USDC- MORA
            IERC20(mora).safeTransfer(xmora, amount1);
            moraOut = _toMORA(token0, amount0).add(amount1);
        } else if (token0 == weth) { // eg. NEON - USDC
            moraOut = _toMORA(weth, _swap(token1, weth, amount1, address(this)).add(amount0));
        } else if (token1 == weth) { // eg. USDC - NEON
            moraOut = _toMORA(weth, _swap(token0, weth, amount0, address(this)).add(amount1));
        } else { // eg. WSOL - USDC
            address bridge0 = moraBridgeFor(token0);
            address bridge1 = moraBridgeFor(token1);
            if (bridge0 == token1) {
                moraOut = _convertToMORAStep(bridge0, token1,
                    _swap(token0, bridge0, amount0, address(this)),
                    amount1
                );
            } else if (bridge1 == token0) {
                moraOut = _convertToMORAStep(token0, bridge1,
                    amount0,
                    _swap(token1, bridge1, amount1, address(this))
                );
            } else {
                moraOut = _convertToMORAStep(bridge0, bridge1,
                    _swap(token0, bridge0, amount0, address(this)),
                    _swap(token1, bridge1, amount1, address(this))
                );
            }
        }
    }

    function _convertToUSDCStep(address token0, address token1, uint256 amount0, uint256 amount1) internal returns(uint256 usdcOut) {
        if (token0 == token1) {
            uint256 amount = amount0.add(amount1);
            if (token0 == usdc) {
                IERC20(usdc).safeTransfer(treasury, amount);
                usdcOut = amount;
            } else if (token0 == weth) {
                usdcOut = _toUSDC(weth, amount);
            } else {
                address bridge = usdcBridgeFor(token0);
                amount = _swap(token0, bridge, amount, address(this));
                usdcOut = _convertToUSDCStep(bridge, bridge, amount, 0);
            }
        } else if (token0 == usdc) { // eg. USDC - NEON
            IERC20(usdc).safeTransfer(treasury, amount0);
            usdcOut = _toUSDC(token1, amount1).add(amount0);
        } else if (token1 == usdc) { // eg. BNB - USDC
            IERC20(usdc).safeTransfer(treasury, amount1);
            usdcOut = _toUSDC(token0, amount0).add(amount1);
        } else if (token0 == weth) { // eg. NEON - BNB
            usdcOut = _toUSDC(weth, _swap(token1, weth, amount1, address(this)).add(amount0));
        } else if (token1 == weth) { // eg. BNB - NEON
            usdcOut = _toUSDC(weth, _swap(token0, weth, amount0, address(this)).add(amount1));
        } else { // eg. WSOL - BNB
            address bridge0 = usdcBridgeFor(token0);
            address bridge1 = usdcBridgeFor(token1);
            if (bridge0 == token1) {
                usdcOut = _convertToUSDCStep(bridge0, token1,
                    _swap(token0, bridge0, amount0, address(this)),
                    amount1
                );
            } else if (bridge1 == token0) {
                usdcOut = _convertToUSDCStep(token0, bridge1,
                    amount0,
                    _swap(token1, bridge1, amount1, address(this))
                );
            } else {
                usdcOut = _convertToUSDCStep(bridge0, bridge1,
                    _swap(token0, bridge0, amount0, address(this)),
                    _swap(token1, bridge1, amount1, address(this))
                );
            }
        }
    }

    function _swap(address fromToken, address toToken, uint256 amountIn, address to) internal returns (uint256 amountOut) {
        IMoraswapV2Pair pair = IMoraswapV2Pair(factory.getPair(fromToken, toToken));
        require(address(pair) != address(0), "MoraMaker: Cannot convert");

        (uint256 reserve0, uint256 reserve1,) = pair.getReserves();
        uint256 amountInWithFee = amountIn.mul(997);
        if (fromToken == pair.token0()) {
            amountOut = amountIn.mul(997).mul(reserve1) / reserve0.mul(1000).add(amountInWithFee);
            IERC20(fromToken).safeTransfer(address(pair), amountIn);
            pair.swap(0, amountOut, to, new bytes(0));
        } else {
            amountOut = amountIn.mul(997).mul(reserve0) / reserve1.mul(1000).add(amountInWithFee);
            IERC20(fromToken).safeTransfer(address(pair), amountIn);
            pair.swap(amountOut, 0, to, new bytes(0));
        }
    }

    function _toMORA(address token, uint256 amountIn) internal returns(uint256 amountOut) {
        amountOut = _swap(token, mora, amountIn, xmora);
    }

    function _toUSDC(address token, uint256 amountIn) internal returns(uint256 amountOut) {
        amountOut = _swap(token, usdc, amountIn, treasury);
    }
}

contracts/Rewarder.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "./interfaces/IRewarder.sol";

contract Rewarder is IRewarder, Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 public immutable rewardToken;
    IERC20 public immutable lpToken;
    address public immutable chef;

    // info of each MasterChef user
    struct UserInfo {
        uint256 amount;
        uint256 rewardDebt;
    }

    // info of each MasterChef poolInfo
    struct PoolInfo {
        uint256 accRewardPerShare;
        uint256 lastRewardTime;
        uint256 totalLp;
    }

    // info of the poolInfo
    PoolInfo public poolInfo;
    // info of each user that stakes LP tokens
    mapping(address => UserInfo) public userInfo;

    uint256 public rewardPerSecond;
    uint256 private constant ACC_TOKEN_PRECISION = 1e18;

    event OnReward(address indexed user, uint256 amount);
    event SetRewardPerSecond(uint256 oldRate, uint256 newRate);

    modifier onlyMasterChef() {
        require(msg.sender == chef, "onlyMasterChef: only MasterChef can call this function");
        _;
    }

    constructor(
        IERC20 _rewardToken,
        IERC20 _lpToken,
        uint256 _rewardPerSecond,
        address _chef,
        uint256 _startTime
    ) public {
        rewardToken = _rewardToken;
        lpToken = _lpToken;
        rewardPerSecond = _rewardPerSecond;
        chef = _chef;
        poolInfo = PoolInfo({lastRewardTime: _startTime, accRewardPerShare: 0, totalLp: 0});

    }

    function setRewardPerSecond(uint256 _rewardPerSecond) external override onlyOwner {
        updatePool();

        uint256 oldRate = rewardPerSecond;
        rewardPerSecond = _rewardPerSecond;

        emit SetRewardPerSecond(oldRate, _rewardPerSecond);
    }

    function reclaimTokens(address token, uint256 amount, address payable to) public onlyOwner {
        if (token == address(0)) {
            to.transfer(amount);
        } else {
            IERC20(token).safeTransfer(to, amount);
        }
    }

    function updatePool() public returns (PoolInfo memory pool) {
        pool = poolInfo;

        if (block.timestamp > pool.lastRewardTime) {
            uint256 lpSupply = pool.totalLp;

            if (lpSupply > 0) {
                uint256 multiplier = block.timestamp.sub(pool.lastRewardTime);
                uint256 tokenReward = multiplier.mul(rewardPerSecond);
                pool.accRewardPerShare = pool.accRewardPerShare.add((tokenReward.mul(ACC_TOKEN_PRECISION).div(lpSupply)));
            }

            pool.lastRewardTime = block.timestamp;
            poolInfo = pool;
        }
    }

    function onReward(address _user, uint256 _amount) external override onlyMasterChef {
        updatePool();
        PoolInfo storage pool = poolInfo;
        UserInfo storage user = userInfo[_user];
        uint256 pendingBal;

        if (user.amount > 0) {
            pendingBal = (user.amount.mul(pool.accRewardPerShare).div(ACC_TOKEN_PRECISION)).sub(user.rewardDebt);
            uint256 rewardBal = rewardToken.balanceOf(address(this));
            if (pendingBal > rewardBal) {
                rewardToken.safeTransfer(_user, rewardBal);
            } else {
                rewardToken.safeTransfer(_user, pendingBal);
            }
        }

        pool.totalLp = pool.totalLp.add(_amount).sub(user.amount);
        user.amount = _amount;
        user.rewardDebt = user.amount.mul(pool.accRewardPerShare).div(ACC_TOKEN_PRECISION);

        emit OnReward(_user, pendingBal);
    }

    function pendingReward(address _user, uint256 _amount) external view override returns (uint256) {
        PoolInfo memory pool = poolInfo;
        UserInfo storage user = userInfo[_user];

        uint256 accRewardPerShare = pool.accRewardPerShare;
        uint256 lpSupply = pool.totalLp;

        if (block.timestamp > pool.lastRewardTime && lpSupply != 0) {
            uint256 multiplier = block.timestamp.sub(pool.lastRewardTime);
            uint256 tokenReward = multiplier.mul(rewardPerSecond);
            accRewardPerShare = accRewardPerShare.add(tokenReward.mul(ACC_TOKEN_PRECISION).div(lpSupply));
        }

        return (user.amount.mul(accRewardPerShare).div(ACC_TOKEN_PRECISION)).sub(user.rewardDebt);
    }
}

